import { useState } from 'react';
import { Col, Container, Nav, Navbar, Row } from 'react-bootstrap'; //
import { Route, Routes, useNavigate } from 'react-router-dom';
import './App.css';
import data from './data.js';
import Detail from './Detail.js';

function App() {
    let [art] = useState(data);
    let navigate = useNavigate();

    return (
        <div className='App'>
            <Navbar bg='light' variant='light' className='Navbar'>
                <Container>
                    <Navbar.Brand href='#home'>일시불</Navbar.Brand>
                    <Nav className='me-auto' className='Navi'>
                        <Nav.Link
                            onClick={() => {
                                navigate('/');
                            }}
                        >
                            홈
                        </Nav.Link>
                        <Nav.Link href='#features'>찾아보기</Nav.Link>
                        <Nav.Link
                            onClick={() => {
                                navigate('/Detail');
                            }}
                        >
                            더보기
                        </Nav.Link>
                        {/* <Link to='/'>홈</Link>
                        <Link to='/Detail'>더보기</Link> */}
                    </Nav>
                </Container>
            </Navbar>

            <Routes>
                <Route
                    path='/'
                    element={
                        <>
                            <div className='Main-bg'></div>
                            <Container>
                                <Row className='row'>
                                    {art.map((a, i) => {
                                        return <MidArt art={art[i]}></MidArt>;
                                    })}
                                </Row>
                            </Container>
                        </>
                    }
                />
                <Route path='/Detail' element={<Detail />} />
                <Route path='*' element={<div>없는페이지 입니다.</div>} />

                <Route path='About' element={<About />}>
                    <Route path='member' element={<About />} />
                    <Route path='location' element={<About />} />
                </Route>
            </Routes>
        </div>
    );
}
function MidArt(props) {
    return (
        <Col className='col-top-1'>
            <img src={props.art.src} width='80%' height='65%' />
            <h4>{props.art.title}</h4>
            <p>{props.art.content}</p>
        </Col>
    );
}
function About() {
    return (
        <div>
            <h4>회사정보</h4>
        </div>
    );
}
export default App;
